import { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";

const GOOGLE_MAPS_API_KEY = process.env.REACT_APP_GOOGLE_MAPS_API_KEY;

const EventDetails = () => {
    const { id } = useParams();
    const navigate = useNavigate();
    const [event, setEvent] = useState(null);
    const [error, setError] = useState(null);
    const [expanded, setExpanded] = useState(false);
    const [showMap, setShowMap] = useState(false);

    useEffect(() => {
        axios
            .get(`http://localhost:5000/events/${id}`)
            .then((response) => setEvent(response.data))
            .catch((error) => {
                console.error("Error fetching event details:", error);
                setError("Failed to load event details. Please try again later.");
            });
    }, [id]);

    if (error) return <p className="text-red-500 text-center mt-4">{error}</p>;
    if (!event) return <p className="text-gray-500 text-center mt-4">Loading event details...</p>;

    return (
        <div className="flex flex-col items-center bg-gray-100 py-10 px-5">
            {/* Event Banner */}
            <div className="mt-12 w-3/5 max-w-2xl rounded-lg overflow-hidden shadow-lg mb-6">
                {event.image ? (
                    <img 
                        src={`http://localhost:5000/${event.image.replace(/\\/g, "/")}`} 
                        alt={event.title} 
                        className="w-full h-auto rounded-lg" 
                    />
                ) : (
                    <p className="text-gray-500 text-center">No Image Available</p>
                )}
            </div>

            {/* Event Content */}
            <div className="bg-white p-6 rounded-lg w-3/5 max-w-2xl shadow-md text-left">
                <h2 className="text-2xl font-bold text-blue-700 mb-3 flex items-center">
                    {event.title} <span className="ml-2 text-lg cursor-pointer text-blue-500">🔗</span>
                </h2>

                <p className="text-gray-700 text-sm mb-3">
                    {expanded ? event.description : `${event.description.substring(0, 100)}...`}
                </p>
                <button className="text-blue-500 font-semibold text-sm" onClick={() => setExpanded(!expanded)}>
                    {expanded ? "Read Less" : "Read More"}
                </button>

                {/* Event Info */}
                <div className="flex justify-between bg-gray-200 p-3 rounded-md mt-4">
                    <div className="text-sm text-gray-700">
                        <p>💰 Price: {event.price || "Not Provided"}</p>
                        <p>📅 Date: {event.date || "Not Provided"}</p>
                        <p>🕒 Time: {event.time || "Not Provided"}</p>
                    </div>
                    <div className="text-sm text-gray-700">
                        <p>📍 Location: {event.location}</p>
                        {event.location && (
                            <>
                                <button className="text-blue-500 text-xs mt-2 underline" onClick={() => setShowMap(!showMap)}>
                                    {showMap ? "Hide Map ▲" : "Show Map ▼"}
                                </button>
                                {showMap && GOOGLE_MAPS_API_KEY ? (
                                    <iframe
                                        title="Google Map"
                                        className="w-full h-72 rounded-md mt-3"
                                        frameBorder="0"
                                        src={`https://www.google.com/maps/embed/v1/place?key=${GOOGLE_MAPS_API_KEY}&q=${encodeURIComponent(event.location)}`}
                                        allowFullScreen
                                    ></iframe>
                                ) : showMap ? (
                                    <p className="text-red-500 text-sm">⚠️ Google Maps API Key is missing or invalid.</p>
                                ) : null}
                            </>
                        )}
                    </div>
                </div>

                {/* Booking Button */}
                <button 
                    onClick={() => navigate(`/payment?event=${id}`)} 
                    className="w-full bg-blue-500 text-white py-3 mt-4 rounded-lg text-lg font-semibold shadow-md hover:bg-blue-700"
                >
                    🎟 Book Now
                </button>
            </div>

            {/* Chat Icon */}
            <div className="fixed bottom-5 right-5 bg-blue-500 text-white p-4 rounded-full cursor-pointer shadow-md hover:bg-blue-700">
                💬
            </div>
        </div>
    );
};

export default EventDetails;
